INSERT INTO `EVIDENCE_BODY` VALUES (271,'2012年12月24日塘沽卫生监督所刘谨钊等人，给其送达了行政处罚决定书，内容是两项，第一是没收先行保存的药品、器械，并处以五千元的罚款，第二是改正违法行为。',2,NULL,5,0,273,NULL,NULL,1,5,-1,-1),(272,'后来通过刘宏找了一个卫生所姓刘的，那人负责医疗卫生检查，每次都是他带人来查，王燕请他吃了饭并先后一共给了4000元钱，目的是为了不交罚款或少交罚款。',2,NULL,5,0,274,NULL,NULL,1,5,-1,-1),(273,'2012年冬天的一天，王燕给其打电话说塘沽卫生所负责检查非法行医的刘谨钊查到他们诊所了',2,NULL,5,0,275,NULL,NULL,1,5,-1,-1),(274,'内容与刘林森证言证实内容基本一致，能互相印证，其证言还证实了 2014年5月21曰、2014年6月间接群众举报对王燕非法行医的地点进行了查处，王燕因涉嫌非法行医被移送到了公安机关。',2,NULL,6,0,276,NULL,NULL,1,5,-1,-1),(275,'其是从2012年开始行医的，在塘沽开办了一个叫天津市塘沽华仁中医药门诊部的个体诊所，诊所有执照，是合法经营。',2,NULL,6,0,277,NULL,NULL,1,5,-1,-1),(276,'其开的诊所名称叫天津市滨海新区塘沽孟繁明中医诊所，刘谨钊是塘沽卫生监督所的监督员，负责对他的诊所进行监督检查。',2,NULL,6,0,278,NULL,NULL,1,5,-1,-1),(499,'1、证人吴秀春在2015年3月7日的证言中陈述到，昨天其丈夫王某某跟其讲不回家吃饭了，其儿子下班后回家了，回家后就再没有出门。',3,NULL,1,0,1938,NULL,NULL,1,0,-1,-1),(500,'2、证人出租车司机，在2015年3月7日凌晨，在外环往浦东机场匝道口有一辆深色的轿车，在车辆边上，车旁就一个人好像没其他人，不像喝过酒的样子。',3,NULL,1,0,1939,NULL,NULL,1,0,-1,-1),(501,'3、道路交通事故现场图及照片、事故现场勘查笔录、当事人血样提取登记表、物损评估意见书、司法鉴定科学技术研究所司法鉴定中心检验报告书，证实车辆事故现场情况、车辆物损情况及被告人王某某血液中乙醇含量为1．69毫克／毫升。',3,NULL,1,0,1940,NULL,NULL,1,1,-1,-1),(502,'1、查获经过及案发经过，证实在2015年3月7日3时许，在罗山路进外环高速往浦东机场方向的匝道上一辆沪ARXXXX荣威轿车发生单车事故，王某某称车辆由其儿子王永磊出门驾驶。',3,NULL,2,1,1941,NULL,NULL,0,5,-1,-1),(503,'2、证人沈某某的证言，证实2015年3月6日晚，其召集了老同事王某某等人一起在新友饭店吃饭，王某某喝了酒，大约到晚上10时30分许结束，当天其和王某某一起离开了新友饭店，当天吃饭期间，讲到谁喝酒，谁就不要开车，当时王某某讲已安排好了。',3,NULL,2,1,1942,NULL,NULL,1,0,-1,-1),(504,'3、证人浦某某的证言，证实2015年3月6日晚上10时左右，其在新友饭店参加朋友沈某某的聚餐，沈某某讲喝了酒不要开车叫代驾，王某某讲已安排好人开车了，后来其也看到王某某好像朝车库走，后面好像跟了一个人。',3,NULL,2,1,1943,NULL,NULL,1,0,-1,-1);
