INSERT INTO `EVIDENCE_DOCUMENT` VALUES (1,3,NULL,'1、证人吴秀春在2015年3月7日的证言中陈述到，昨天其丈夫王某某跟其讲不回家吃饭了，其儿子下班后回家了，回家后就再没有出门。2、证人出租车司机，在2015年3月7日凌晨，在外环往浦东机场匝道口有一辆深色的轿车，在车辆边上，车旁就一个人好像没其他人，不像喝过酒的样子。3、道路交通事故现场图及照片、事故现场勘查笔录、当事人血样提取登记表、物损评估意见书、司法鉴定科学技术研究所司法鉴定中心检验报告书，证实车辆事故现场情况、车辆物损情况及被告人王某某血液中乙醇含量为1．69毫克／毫升。\n',0),(2,3,NULL,'1、查获经过及案发经过，证实在2015年3月7日3时许，在罗山路进外环高速往浦东机场方向的匝道上一辆沪ARXXXX荣威轿车发生单车事故，王某某称车辆由其儿子王永磊出门驾驶。2、证人沈某某的证言，证实2015年3月6日晚，其召集了老同事王某某等人一起在新友饭店吃饭，王某某喝了酒，大约到晚上10时30分许结束，当天其和王某某一起离开了新友饭店，当天吃饭期间，讲到谁喝酒，谁就不要开车，当时王某某讲已安排好了。3、证人浦某某的证言，证实2015年3月6日晚上10时左右，其在新友饭店参加朋友沈某某的聚餐，沈某某讲喝了酒不要开车叫代驾，王某某讲已安排好人开车了，后来其也看到王某某好像朝车库走，后面好像跟了一个人。',1);
